INSERT INTO `contents` VALUES ('19', '0', '16', 'แบบฟอร์ม สสธท / กสธท', '<h2><span style=\"color: #ff0000;\">สสธท. แบบฟอร์ม</span></h2>\r\n<p><a href=\"http://file.siam2web.com/cpct/jj2.pdf\" target=\"_blank\">แบบฟอร์มใบสมัครประเภทสามัญ<br /> </a><a href=\"http://file.siam2web.com/cpct/jj1.pdf\" target=\"_blank\">แบบฟอร์มใบสมัครประเภทสมทบ ที่เป็นคู่สมรส หรือ บิดา&nbsp; มารดา&nbsp; หรือบุตรของสมาชิก<br /> </a><a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-Q0dpdFZpODJFSVk/edit\" target=\"_blank\">หนังสือแจ้งการโอนย้าย</a><br /> <a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-Z1FXY3UyOWl2MG8/edit\" target=\"_blank\">หนังสือแจ้งการขอเปลี่ยนหรือเพิ่มจำนวนผู้รับเงินสงเคราะห์</a><br /> <a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-aXFPVk5OU1pITUE/edit\" target=\"_blank\">หนังสือแจ้งการขอเปลี่ยนแปลง ชื่อ - นามสกุล และ ที่อยู่ สสธท.</a><br /> <a href=\"http://file.siam2web.com/cpct/w(2).pdf\" target=\"_blank\">ใบตอบรับศูนย์ประสานงานและใบสมัครจนท.ศูนย์ประสานงาน</a><br /> <a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-Z1hsVDBROEtNNk0/edit\" target=\"_blank\">หนังสือยินยอมและมอบอำนาจการรับเงินสงเคราะห์ </a><br /> <a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-bUdYdlZHMHJVbGM/edit\" target=\"_blank\">หนังสือแจ้งการลาออก</a><br /> <a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-aFN3bzZZMlpIQW8/edit\" target=\"_blank\">หนังสือแจ้งการขอเปลี่ยนหรือลดจำนวนผู้รับเงินสงเคราะห์</a><br /> <a href=\"http://file.siam2web.com/cpct/files[document]/20161025_58845.pdf\" target=\"_blank\">ใบสำคัญการจ่ายเงินสงเคราะห์(สสธท.)</a><br /> <a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-Q2lROEk2YU9rRk0/edit\" target=\"_blank\">หลักฐานการจ่ายเงิน</a><br /> <a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-UUlvb2lpeTdZaTA/edit\" target=\"_blank\">Bill Payment </a><br /> <a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-NkF2RWlGOVUwdjQ/edit\" target=\"_blank\">แบบฟอร์มรายชื่อตามบัญชีรายละเอียดแนบท้ายสมาชิกที่ไม่ชำระเงินสงเคราะห์ล่วงหน้าและเงินบำรุงปี 2558(ไม่ต่ออายุุ)</a><br /> <a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-RWI5cnZHWlo0aDQ/edit\" target=\"_blank\">แบบฟอร์มรายชื่อตามบัญชีรายละเอียดแนบท้ายสมาชิกที่ยืนยันชำระเงินสงเคราะห์ล่วงหน้าและเงินบำรุงปี 2558 โดยหักจากเงินปันผลสหกรณ์ออมทรัพย์</a><br /> <a href=\"https://docs.google.com/file/d/0B61IKF9VkLE-b21HME5SRXl4YWc/edit\" target=\"_blank\">ใบแสดงความจำนงบริจาคเงินโดยสมัครใจ</a><br /> <a href=\"http://file.siam2web.com/cpct/aa10.pdf\" target=\"_blank\">แบบฟอร์มการนำส่งเงินของศูนย์ประสานงาน&nbsp;</a><br /> <a href=\"https://drive.google.com/file/d/0B61IKF9VkLE-S2RfRUloS3J1NWs/view?usp=sharing\" target=\"_blank\">คู่มือปฏิบัติการ 2558<br /> </a></p>\r\n<h2><span style=\"color: #ff0000;\">แบบฟอร์ม กสธท.</span></h2>\r\n<p><a href=\"http://file.siam2web.com/cpct/files[document]/FFeb2016/2017228_35545.pdf\" target=\"_blank\">โหลดใบสมัคร กสธท.</a><br /> <a href=\"http://file.siam2web.com/cpct/files[document]/FDEM59/20161227_44733.pdf\" target=\"_blank\">โหลดแบบฟอร์มใบลาออก กสธท.</a><br /> <a href=\"http://file.siam2web.com/cpct/files[document]/FJAN60/2017113_64158.pdf\" target=\"_blank\">Bill Payment</a></p>', '106', '1', '0', '0', '2017-07-14 11:07:36', '2017-09-08 15:48:41');
